import base64
from PIL import Image
import io

b64 = ""
data = base64.b64decode(b64)
print(f"File size: {len(data)} bytes")

img = Image.open(io.BytesIO(data))
print(f"Mode: {img.mode}, Size: {img.size}")

# Analyze alpha channel
if img.mode == "RGBA":
    r, g, b, a = img.split()
    import numpy as np
    alpha = np.array(a)
    print(f"Alpha stats: min={alpha.min()}, max={alpha.max()}, mean={alpha.mean():.1f}")
    # Count fully transparent vs opaque
    fully_transparent = (alpha == 0).sum()
    fully_opaque = (alpha == 255).sum()
    total = alpha.size
    print(f"Fully transparent: {fully_transparent}/{total} ({100*fully_transparent/total:.1f}%)")
    print(f"Fully opaque: {fully_opaque}/{total} ({100*fully_opaque/total:.1f}%)")
    # Find bounding box of non-transparent area
    non_transparent = np.where(alpha > 0)
    if len(non_transparent[0]) > 0:
        print(f"Non-transparent area: rows {non_transparent[0].min()}-{non_transparent[0].max()}, cols {non_transparent[1].min()}-{non_transparent[1].max()}")
